class sprite_drawer():
    def __init__(self):
        self.x = 0
        self.y = 0
        self.sprite_width = 0
        self.sprite_height = 0
        self.i = 0
        self.a = 0
        self.sprite = []
    
    def draw_pixel(self, r, g, b):
        starting_a = self.a
        self.a += 1

        if self.a < len(sprite[i]) - 1:
            while r == sprite[self.i][self.a][0] and g == sprite[self.i][self.a][1] and b == sprite[self.i][self.a][2]:
                self.a += 1
                if self.a >= len(sprite[i]) - 1:
                    break
        
        pixel_length = self.a - starting_a
        
        if (r + g + b) > 0:
            turtle.color(r, g, b)
            turtle.shapesize(0.149, 0.149 * pixel_length)
            self.x = 3 * (starting_a + pixel_length / 2)
            turtle.setposition(self.x, self.y)
            turtle.stamp()
            self.x = 3 * (starting_a + pixel_length)

    def rollover(self):
        self.x = 0
        self.y = 0 - self.i * 3


    def draw_sprite(self, sprite):
        self.sprite = sprite
        self.sprite_width = len(sprite[1])
        self.sprite_height = len(sprite)
        self.i = 0
        self.a = 0
        turtle.setheading(0)
        while self.i < len(sprite):
            while self.a < len(sprite[1]):
                self.draw_pixel(sprite[self.i][self.a][0], sprite[self.i][self.a][1], sprite[self.i][self.a][2]) 
            self.rollover()
            self.a = 0
            self.i += 1
        self.i = 0


